import React,{useEffect,useState} from 'react';

const Pictures = () => {

const [feed,setFeed] = useState([]);

    useEffect(()=> {
        fetch(`https://api.tumblr.com/v2/blog/t:lDAjSdcnJP4LldXNaqgTvw/posts?api_key=jIc93HviY2JB5XB9lhum3NtqwOhTZtmWw8A3HNZYmw8YpSgSK7`).then(res => res.json())
        .then(data => setFeed(data.response.posts));  
    },[])


return (
        <div> 
            {
feed.map((url,i) => <img key={i} src={url.post_url} alt=''></img>)
            }
        </div>
    )

}

export default Pictures;
